import{_ as e,o,c as i,O as n}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 63.2-510 Obligation of person to support certain children living in same home; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-510.md","filePath":"vacode/63.2-510.md"}'),a={name:"vacode/63.2-510.md"},t=n('<h1 id="§-63-2-510-obligation-of-person-to-support-certain-children-living-in-same-home-penalty" tabindex="-1">§ 63.2-510 Obligation of person to support certain children living in same home; penalty. <a class="header-anchor" href="#§-63-2-510-obligation-of-person-to-support-certain-children-living-in-same-home-penalty" aria-label="Permalink to &quot;§ 63.2-510 Obligation of person to support certain children living in same home; penalty.&quot;">​</a></h1><p>A person is responsible for the support and maintenance of any child or children living in the same home in which he and the natural or adoptive parent of such child or children cohabit as spouses and any such person who without cause willfully neglects or refuses or fails to provide for such support and maintenance is guilty of a misdemeanor and upon conviction shall be punished in accordance with the provisions of § <a href="/vacode/20-61/">20-61</a>.</p><p>A pregnancy or the birth of a child during the time a person occupies the status set out above shall not be required as proof of cohabitation.</p><p>The obligations imposed herein shall continue so long as such person occupies the status herein described.</p><p>1972, c. 536, § 63.1-90.1; 1974, c. 464; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0900" target="_blank" rel="noreferrer">900</a>.</p>',5),r=[t];function s(c,l,p,h,d,u){return o(),i("div",null,r)}const g=e(a,[["render",s]]);export{_ as __pageData,g as default};
